import React from "react";

function Details() {
  return (
    <>
      <div className="container mt-4">
        <h2>Hello, Alok Kumar</h2>

        <div class="card" style={{ maxWidth: "600px" }}>
          <div class="card-body row">
            <div>
              <img
                src="/assets/userImg.png"
                style={{ width: "100px" }}
                className="rounded-circle mb-2"
              />
            </div>
            <div className="left-view col-md-6 col-sm-12">
              <h6>
                {" "}
                Name : <span className="mt-5 fw-light">Alok Kumar</span>
              </h6>
              <h6>
                {" "}
                Age : <span className="mt-5 fw-light">22</span>
              </h6>
              <h6>
                {" "}
                <i class="fa-solid fa-envelope"></i> Email :{" "}
                <span className="mt-5 fw-light">alok@2344gmail.com</span>
              </h6>
              <h6>
                {" "}
                <i class="fa-solid fa-briefcase"></i>Occuption :{" "}
                <span className="mt-5 fw-light">Developer</span>
              </h6>
            </div>
            <div className="right-view col-md-6 col-sm-12">
              <h6>
                <i class="fa-solid fa-mobile-screen"></i> Mobile :{" "}
                <span className="mt-5 fw-light">3332233443</span>
              </h6>
              <h6>
                <i class="fa-solid fa-location-dot"></i> Location :{" "}
                <span className="mt-5 fw-light">maharajganj</span>
              </h6>
              <h6>
                {" "}
                Description :{" "}
                <span className="mt-5 fw-light">
                  Developed a web application using HTML, CSS, and JavaScript to
                  solve a specific problem/deliver a particular functionality.
                  Designed and implemented the user interface, ensuring a
                  seamless user experience across different devices.{" "}
                </span>
              </h6>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Details;
